vector: true

script: |
  super -f text -I q1366.spq | sort > q1366.out

inputs:
  - name: q1366.spq
    data: |
      SELECT d-e,
      a,
      b
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b);
  - name: t1

outputs:
  - name: q1366.out
    data: |
      -2	191	194
      1	220	223
      2	245	249
